uint8_t truly_lcd_flag = 0;

extern uint8_t task_start_flag;
uint64_t te_count = 0;
static void te_int_handle(void)
{
	te_count++;	
	
}

static void drv_lcd_te_irq_init(void)
{
	am_hal_gpio_int_register(BSP_GPIO_LCD_TE, te_int_handle);
	am_hal_gpio_pin_config(BSP_GPIO_LCD_TE,AM_HAL_GPIO_INPUT);
	am_hal_gpio_int_polarity_bit_set(BSP_GPIO_LCD_TE,AM_HAL_GPIO_RISING);
	am_hal_gpio_int_clear(AM_HAL_GPIO_BIT(BSP_GPIO_LCD_TE));
	
	am_hal_gpio_int_enable(AM_HAL_GPIO_BIT(BSP_GPIO_LCD_TE));

	am_util_delay_ms(5);;

}

void drv_lcd_te_irq_disable(void)
{

	am_hal_gpio_int_disable(AM_HAL_GPIO_BIT(BSP_GPIO_LCD_TE));

}

void drv_lcd_te_irq_enable(void)
{
	am_hal_gpio_int_enable(AM_HAL_GPIO_BIT(BSP_GPIO_LCD_TE));

}


//判断是否有te信号
uint8_t whether_lcd_te_high(void)
{
	uint64_t tmp_count= 0;
	uint16_t cycle_index = 0;
	uint8_t ret = 0;
	tmp_count = te_count;
	
	while ((te_count <= tmp_count)&&(cycle_index < 200))
	{	
		vTaskDelay(1);
		cycle_index++;		
	}
	DRV_LCD_LOG_PRINTF("whether_lcd_te_high %d\r\n",cycle_index);
	if (te_count > tmp_count)
	{
		DRV_LCD_LOG_PRINTF("cd_te_is_high\r\n");
		ret = 1;
	}

	return ret;
}

