static void LCD_PWM_Init(void)
{
	am_hal_gpio_pin_config(BSP_GPIO_LCD_XFRP,BSP_GPIO_CFG_LCD_XFRP);
	am_hal_gpio_pin_config(BSP_GPIO_LCD_VCOM,BSP_GPIO_CFG_LCD_VCOM);
	
	//A1,频率为60Hz
    am_hal_ctimer_config_single(BSP_LCD_XFRP_CTIMER_NUM, BSP_LCD_XFRF_CTIMER_SEGMENT,
                                (AM_HAL_CTIMER_FN_PWM_REPEAT |
                                 AM_HAL_CTIMER_LFRC_512HZ |
                                 AM_HAL_CTIMER_PIN_ENABLE));
    am_hal_ctimer_period_set(BSP_LCD_XFRP_CTIMER_NUM, BSP_LCD_XFRF_CTIMER_SEGMENT, 8, 4);
    am_hal_ctimer_start(BSP_LCD_XFRP_CTIMER_NUM, BSP_LCD_XFRF_CTIMER_SEGMENT);
	
	//B1,频率为反向60Hz
	am_hal_ctimer_config_single(BSP_LCD_VCOM_CTIMER_NUM, BSP_LCD_VCOM_CTIMER_SEGMENT,
                                (AM_HAL_CTIMER_FN_PWM_REPEAT |
                                 AM_HAL_CTIMER_LFRC_512HZ |
								 AM_HAL_CTIMER_PIN_INVERT |
                                 AM_HAL_CTIMER_PIN_ENABLE));
    am_hal_ctimer_period_set(BSP_LCD_VCOM_CTIMER_NUM, BSP_LCD_VCOM_CTIMER_SEGMENT, 8, 4);
    am_hal_ctimer_start(BSP_LCD_VCOM_CTIMER_NUM, BSP_LCD_VCOM_CTIMER_SEGMENT);
}
#endif
void LCD_Poweron(void)
{	
#ifdef WATCH_COD_BSP 
		am_hal_gpio_pin_config(BSP_GPIO_LCD_PWR,AM_HAL_GPIO_OUTPUT);
		am_hal_gpio_out_bit_set(BSP_GPIO_LCD_PWR);
		am_util_delay_ms(5);
#else

	//VDD1
	am_hal_gpio_pin_config(BSP_GPIO_LCD_VDD1,AM_HAL_GPIO_OUTPUT);
	LCD_VDD1_HIGH();
	am_util_delay_ms(1);
	
	//VDD2
	am_hal_gpio_pin_config(BSP_GPIO_LCD_VDD2,AM_HAL_GPIO_OUTPUT);
	LCD_VDD2_HIGH();
	am_util_delay_ms(5);
#endif
}

void LCD_Poweroff(void)
{
#ifdef WATCH_COD_BSP 
		am_hal_gpio_out_bit_clear(BSP_GPIO_LCD_PWR);
#else
	LCD_DisplayOff();
	
	//VDD2
	LCD_VDD2_LOW();
	am_util_delay_ms(1);
	
	//VDD1
	LCD_VDD1_LOW();
	am_util_delay_ms(1);
#endif
}

void LCD_DisplayOn(void)
{
#ifdef WATCH_COD_BSP 
#else

	am_util_delay_ms(1);
	
	LCD_PWM_Init();
	am_util_delay_ms(1);
#endif
}

void LCD_DisplayOff(void)
{	
#ifdef WATCH_COD_BSP 
#else

	//停止输出64HZ
	am_hal_ctimer_stop(BSP_LCD_XFRP_CTIMER_NUM, BSP_LCD_XFRF_CTIMER_SEGMENT);
	am_hal_ctimer_stop(BSP_LCD_VCOM_CTIMER_NUM, BSP_LCD_VCOM_CTIMER_SEGMENT);
	
//	am_hal_gpio_pin_config(BSP_GPIO_LCD_XFRP,AM_HAL_GPIO_3STATE);
//	am_hal_gpio_pin_config(BSP_GPIO_LCD_VCOM,AM_HAL_GPIO_3STATE);
	am_hal_gpio_pin_config(BSP_GPIO_LCD_XFRP,AM_HAL_GPIO_OUTPUT);
	am_hal_gpio_out_bit_clear(BSP_GPIO_LCD_XFRP);
	
	am_hal_gpio_pin_config(BSP_GPIO_LCD_VCOM,AM_HAL_GPIO_OUTPUT);
	am_hal_gpio_out_bit_clear(BSP_GPIO_LCD_VCOM);
	
	am_util_delay_ms(5);
#endif
}
