//屏复位
void drv_lcd_reset(void)
{
	am_hal_gpio_out_bit_set(BSP_GPIO_LCD_REST);
	am_util_delay_ms(20);
	am_hal_gpio_out_bit_clear(BSP_GPIO_LCD_REST);
	am_util_delay_ms(20);
	am_hal_gpio_out_bit_set(BSP_GPIO_LCD_REST);
	am_util_delay_ms(100);

}


//屏放电
void drv_lcd_discharge(void)
{
	drv_lcd_enable();
	drv_lcd_ctrl_write(0x28);//display off 
	drv_lcd_disable();
	am_util_delay_ms(100); 
	drv_lcd_enable();
	drv_lcd_ctrl_write(0x10);//power off
	drv_lcd_disable();
	am_util_delay_ms(100); 

}
