static void LCD_SetRGB(uint8_t data)
{
	AM_REGn(GPIO, 0, WTA) = (AM_REGn(GPIO, 0, WTA) & 0xFFFE23FF) | (data<<10);
}

static void LCD_SetDataInHorizontal(uint16_t line,uint8_t *pixelBuf)
{
	uint16_t pixelCntInLine;
	uint8_t pixel1,pixel2,pixelData;
	
//	if(((uint32_t *)pixelBuf > (uint32_t *)0x10010000) 
//		|| ((uint32_t *)pixelBuf < (uint32_t *)0x10000000))
//	{
//		//刷屏指针指飞，重启手表
//		
//#ifdef ERROR_CODE		
//			LCD_Error_Code(10,0);
//#endif		
//		
//		return;
//	}

	LCD_InvertVck(); 
//	am_util_delay_us(37);
	LCD_HST_HIGH();
	
//	am_util_delay_us(1);//0.34us
	LCD_InvertHck();
	
//	am_util_delay_us(1);//0.34us
//	LCD_InvertHck();

//	am_util_delay_us(1);//0.34us
	LCD_HST_LOW();
	
	for (pixelCntInLine = 0; pixelCntInLine < (LCD_LINE_CNT_MAX/2); ) 
	{
		pixel1 = *pixelBuf;
		pixelBuf--;
		pixel2 = *pixelBuf;
		pixelBuf--;
		if(line%2 != 1)
		{
			pixelData = ((pixel1&0x07)<<4)|(pixel2&0x07);
		}
		else
		{
			pixelData = (pixel1&0x70)|((pixel2&0x70)>>4);
		}
		LCD_SetRGB(pixelData);          /**< set RGB data, even + odd   */

//		am_util_delay_us(1);//0.34us;
		LCD_InvertHck();                          /**< invert HCK                 */
		
//		am_util_delay_us(1);//0.34us;
		pixelCntInLine++;
		
		pixel1 = *pixelBuf;
		pixelBuf--;
		pixel2 = *pixelBuf;
		pixelBuf--;
		if(line%2 != 1)
		{
			pixelData = ((pixel1&0x07)<<4)|(pixel2&0x07);
		}
		else
		{
			pixelData = (pixel1&0x70)|((pixel2&0x70)>>4);
		}
		LCD_SetRGB(pixelData);          /**< set RGB data, even + odd   */

//		am_util_delay_us(1);//0.34us;
		LCD_InvertHck();                          /**< invert HCK                 */
		
//		am_util_delay_us(1);//0.34us;
		pixelCntInLine++;
		if(m_enableEnb)
		{
			if(pixelCntInLine == 4||pixelCntInLine == 104)
			{
				LCD_InvertEnb();
			}
		}
	}
	LCD_SetRGB(0x00); 
//	am_util_delay_us(1);//0.68us
//	LCD_InvertHck();
//	am_util_delay_us(1);//0.68us
	LCD_InvertHck();
	
	m_enableEnb = false;
}
