/**
  * @brief  Update the panel with image from display buffer
  * @param  starline:  Starting line number (0-239).
  * @param  len:  line length (<=240)
  * @retval
  */
void LCD_DisplaySomeLine(uint16_t starline,uint16_t len)
{
#ifdef WATCH_COD_BSP  
		uint16_t endline = starline + len -1;
		uint16_t tmpline;
		
		for (tmpline = starline ;tmpline <= endline ;tmpline++)
		{
			for(uint8_t i= 0;i < LCD_PIXEL_ONELINE_MAX;i++)
			{
			g_dispBuf[tmpline][i] = ((g_dispBuf[tmpline][i] & 0x40) >>3) |(g_dispBuf[tmpline][i] &0x04) | ((g_dispBuf[tmpline][i] &0x02) << 3) 
					|((g_dispBuf[tmpline][i] &0x20))| ((g_dispBuf[tmpline][i] &0x10)<<3)| ((g_dispBuf[tmpline][i] &0x01)<< 6);
			}
		}
		drv_lcd_enable();
		drv_lcd_ctrl_write(0x2a);		// Column Address Set
		drv_lcd_data_write(0x00);		// 
		drv_lcd_data_write(0x3b);		
		
		drv_lcd_ctrl_write(0x2b);		// Row Address Set
		drv_lcd_data_write(starline);		// 
		drv_lcd_data_write(endline);		// 
		
	
		//drv_lcd_switch_lpm_to_hpm();
		
	
		
		drv_lcd_ctrl_write(0x2c);
	
		
		for (tmpline = starline ;tmpline <= endline ;tmpline++)
		{
 		
			drv_lcd_block_data_write((uint32_t *)g_dispBuf[tmpline],LCD_PIXEL_ONELINE_MAX); 
		}
	
		//DRV_LCD_LOG_PRINTF("g_dispBuf  = %x\r\n",g_dispBuf[120][120]);
		
		//drv_lcd_switch_hpm_to_lpm();
		drv_lcd_disable();
		//timer_lcd_start();
	
#else

	int16_t i;
	m_enableEnb = false;
	
	LCD_XRST_LOW();
	LCD_VST_LOW();
	LCD_VCK_LOW();
	LCD_HST_LOW();
	LCD_HCK_LOW();
	LCD_ENB_LOW();
	LCD_SetRGB(0);
	
	am_util_delay_us(10);//10.2us
	
	LCD_XRST_HIGH(); 
	am_util_delay_us(1);//0.68us
	
	LCD_VST_HIGH();
//	am_util_delay_us(1);//0.34us
	LCD_InvertVck();
	am_util_delay_us(1);
	LCD_VST_LOW();                         /**< set low level on VST. Except the first line, keep "L" level    */
//	am_util_delay_us(75);//75.38us
	
	for(i = (LCD_LINE_CNT_MAX*2 - 1);i >= 0;)
	{	
		if((i>=(starline*2)) && (i<(starline*2+len*2)))
		{			
			LCD_SetDataInHorizontal(i,&g_dispBuf[i/2][LCD_PIXEL_ONELINE_MAX-1]);	
			m_enableEnb = true;
			i--;
			LCD_SetDataInHorizontal(i,&g_dispBuf[i/2][LCD_PIXEL_ONELINE_MAX-1]);
			m_enableEnb = true;
			i--;
		}
		else
		{
			LCD_InvertVck();
			i--;
			if(m_enableEnb)
			{
				m_enableEnb = false;
				LCD_InvertEnb();
				LCD_InvertEnb();
			}
			LCD_InvertVck();
			i--;
		}
	}

	LCD_InvertVck();                                  /**< set low level on VCK  */
//	am_util_delay_us(5);//5.36us
	if(m_enableEnb)
	{
		LCD_InvertEnb();                      /**< set high level on ENB  */
	//	am_util_delay_us(63);//63.32us-1689
		LCD_InvertEnb();                      /**< set low level on ENB   */
	//	am_util_delay_us(7);//6.7us-179
	}
	LCD_InvertVck();
//	am_util_delay_us(75);//75.38us-2010
	LCD_InvertVck();
	LCD_InvertVck();
//	am_util_delay_us(75);//75.38us-2010
	LCD_InvertVck();
	
	LCD_XRST_LOW();                /**< set low level on XRST  */
	LCD_InvertVck();
//	am_util_delay_us(75);//75.38us-2010
	LCD_InvertVck();
#endif
}

