/**
  * @brief  得到圆上某点的坐标
  * @param  centerx: Center X coordinate.
  * @param  centery: Center Y coordinate.
  * @param  angle: 以12点方向为起点，顺时针旋转角度(0-360)
  * @param  radius: 圆的半径
  * @retval p_x: 目标点X轴
  * @retval p_y: 目标点Y轴
  */
void get_circle_point(uint16_t centery, uint16_t centerx, uint16_t angle,
						uint16_t radius,uint16_t *p_x,uint16_t *p_y)
{
	int16_t ang;
	float pi = 3.1415926;
	
	angle = angle % 360;
	if(angle < 270)
	{
		ang = angle - 90;
	}
	else
	{
		ang = angle - 450;
	}
	
	*p_x = centerx + (radius * cos(ang * pi / 180.f));
	*p_y = centery + (radius * sin(ang * pi / 180.f));
}

static void draw_arc(uint8_t centery, uint8_t centerx, uint8_t radius, uint8_t thickness, 
						uint16_t startangle, uint16_t endangle, uint8_t pencolor)
{
	uint16_t i,j;
	int32_t a,b,c;
	uint16_t startx,starty;
	uint16_t endx,endy;
	uint16_t radius_max,radius_min;
	uint16_t x_max,y_max;
	uint16_t x_min,y_min;
	
	if(startangle > endangle)
	{
		return;
	}
	
	//外圈半径
	radius_max = radius;
	
	//内圈半径
	if(thickness < radius)
	{
		radius_min = radius - thickness;
	}
	else
	{
		radius_min = 0;
	}
	
	//圆弧起点和终点坐标
	get_circle_point(centery, centerx, startangle, radius_max, &startx,&starty);
	get_circle_point(centery, centerx, endangle, radius_max, &endx,&endy);
	
	//将图像整体向右移一个像素
//	centerx += 1;
	
	//防止超出边界
	y_max = centery + radius_max;
	if(y_max < LCD_LINE_CNT_MAX)
	{
		y_max += 1;
	}
	else
	{
		y_max = LCD_LINE_CNT_MAX;
	}
	
	if(centery < radius_max)
	{
		y_min = 0;
	}
	else
	{
		y_min = centery - radius_max;
	}
	
	x_max = centerx + radius_max;
	if(x_max < LCD_PIXEL_ONELINE_MAX)
	{
		x_max += 1;
	}
	else
	{
		x_max = LCD_PIXEL_ONELINE_MAX;
	}
	
	if(centerx < radius_max)
	{
		x_min = 0;
	}
	else
	{
		x_min = centerx - radius_max;
	}
	
	b = radius_max * radius_max;
	c = radius_min * radius_min;

	if(startangle < 180)
	{
		//起点在右半部分
		if(endangle < 180)
		{
			//终点在右半部分
			for(i = y_min; i < y_max; i++)
			{
				for(j = centerx; j < x_max; j++)
				{
					a = (i - centery)*(i - centery ) + (j - centerx)*(j - centerx);
					if(((a <= b) && (a >= c))
						&& ((startx - j)*(centery - i) - (starty - i) * (centerx - j) <= 0)
						&& ((endx - j)*(centery - i) - (endy - i) * (centerx - j) >= 0))
					{
						g_dispBuf[i][j] = pencolor;
					}
				}
			}
		}
		else
		{
			//终点在左半部分
			for(i = y_min; i < y_max; i++)
			{
				for(j = x_min; j < x_max; j++)
				{
					a = (i - centery)*(i - centery ) + (j - centerx)*(j - centerx);
					if((a <= b) && (a >= c))
					{
						if(j <= centerx)
						{
							//左半部分
							if((endx - j)*(centery - i) - (endy - i) * (centerx - j) >= 0)
							{
								g_dispBuf[i][j] = pencolor;
							}
						}
						else if(j > centerx)
						{
							//右半部分
							if((startx - j)*(centery - i) - (starty - i) * (centerx - j) <= 0)
							{
								g_dispBuf[i][j] = pencolor;
							}
						}
//						else
//						{
//							g_dispBuf[i][j] = pencolor;
//						}
					}
				}
			}
		}
	}
	else
	{
		//起点和终点都在左半部分
		for(i = y_min; i < y_max; i++)
		{
			for(j = x_min; j < centerx; j++)
			{
				a = (i - centery)*(i - centery ) + (j - centerx)*(j - centerx);
				if(((a <= b) && (a >= c))
					&& ((startx - j)*(centery - i) - (starty - i) * (centerx - j) <= 0)
					&& ((endx - j)*(centery - i) - (endy - i) * (centerx - j) >= 0))
				{
					g_dispBuf[i][j] = pencolor;
				}
			}
		}
	}
}

/**
  * @brief  Draw an arc (最大圆环耗时 < 55ms)
  * @param  centerx: Center X coordinate.
  * @param  centery: Center Y coordinate.
  * @param  radius: arc radius
  * @param  thickness: arc thickness.
  * @param  startangle: Start angle. 以12点方向为起点，顺时针旋转角度(0-359)
  * @param  endangle: End angle. 以12点方向为起点，顺时针旋转角度(0-360)
  * @param  pencolor: pen color.
  * @retval
  */
void LCD_SetArc(uint8_t centery, uint8_t centerx, uint8_t radius, uint8_t thickness, 
				uint16_t startangle, uint16_t endangle, uint8_t pencolor)
{	
	if((startangle == 0) && (endangle == 0))
	{
		return;
	}
	
	startangle = startangle % 360;
	endangle = (endangle == 360) ? endangle : (endangle % 360);
	
	if((startangle == endangle) || ((startangle + 360) == endangle))
	{
		//整圆环
		LCD_SetCircle(centery, centerx, radius, pencolor, thickness, LCD_FILL_DISABLE);
	}
	else
	{
		if(startangle < endangle)
		{
			//起始角度比终点角度小
			draw_arc(centery, centerx, radius, thickness, startangle, endangle, pencolor);
		}
		else
		{
			//起始角度比终点角度大
			draw_arc(centery, centerx, radius, thickness, startangle, 360, pencolor);
			draw_arc(centery, centerx, radius, thickness, 0, endangle, pencolor);
		}
	}
}

/**
  * @brief  Image/bitmap
  * @param  destx:  Destination X coordinate (0-239).
  * @param  desty:  Destination Y coordinate (0-239).
  * @param  forecolor:   Foreground color.
  * @param  bckgrndcolor:   Background color.
  * @param  imgParams:  Picture display parameters structure @ref LCD_ImgStruct
  * @retval
  */
void LCD_SetPicture( uint8_t destx, uint8_t desty, uint8_t forecolor, 
						uint8_t bckgrndcolor, const LCD_ImgStruct *imgParams)
{
	uint16_t i,j,k,x,y;
	uint8_t width,height,pxlen;
	uint8_t data,temp,back;
	uint8_t *p_font = NULL;
	
	x = destx;
	if( desty == LCD_CENTER_JUSTIFIED )
	{
		//居中显示
		if(imgParams->width > LCD_PIXEL_ONELINE_MAX)
		{
			y = 0;
		}
		else
		{
			y = (LCD_PIXEL_ONELINE_MAX - imgParams->width) / 2;
		}
	}
	else
	{
		y = desty;
	}
	
	p_font = (uint8_t *)imgParams->pxdata;
	
	height = imgParams->height;
	if((LCD_LINE_CNT_MAX - x) < height)
	{
		//防止溢出
		height = LCD_LINE_CNT_MAX - x;
	}
	
	width = imgParams->width;
	if((LCD_PIXEL_ONELINE_MAX - y) < width)
	{
		//防止溢出
		width = LCD_PIXEL_ONELINE_MAX - y;
	}
	
	switch(imgParams->imgtype)
	{
		case LCD_6BIT_COLOR:
			//显示带颜色的图
			for(i = 0; i < height; i++)
			{	
				for(j=0; j < width; j++)
				{
					//获取当前点数据
					data = *p_font++;
					if(forecolor != LCD_NONE)
					{
						data = (data & 0x88) | forecolor;
					}
					
					//获取当前点背景数据
					if(bckgrndcolor != LCD_NONE)
					{
						back = bckgrndcolor;
					}
					else
					{
						back = g_dispBuf[x+i][y+j];
					}
					
					switch(data & 0x88)
					{
						case 0x88:
							temp = data & 0x77;
							break;
						case 0x80:
							temp = (data & 0x70) | (back & 0x07);
							break;
						case 0x08:
							temp = (back & 0x70) | (data & 0x07);
							break;
						default:
							temp = back;
							break;
					}
					
					g_dispBuf[x+i][y+j] = temp;
				}
			}
			break;
		case LCD_1BIT_BITMAP:
			//显示点阵图
			pxlen = ceil(imgParams->width/8.f);
			for(i=0; i < height; i++)
			{
				for(j = 0; j < width; j++)
				{
					if(p_font[pxlen*i+j/8] & (0x80>>(j%8)))
					{
						g_dispBuf[x + i][y + j] = forecolor;
					}
					else
					{
						if(bckgrndcolor != LCD_NONE)
						{
							g_dispBuf[x + i][y + j] = bckgrndcolor;
						}
					}
				}
			}
			break;
		case LCD_2BPP_GRSCL:
			//2bit灰度图
			if(forecolor == LCD_NONE)
			{
				forecolor = LCD_BLACK;
			}
			
			for(i = 0; i < height; i++)
			{
				for(j = 0; j < width; )
				{
					//获取当前点数据
					data = *p_font++;
					for(k = 0; k < 4; k++)
					{
						//获取当前点背景数据
						if(bckgrndcolor != LCD_NONE)
						{
							back = bckgrndcolor;
						}
						else
						{
							back = g_dispBuf[x+i][y+j];
						}
						
						switch(data & 0x03)
						{
							case 0x00:
								temp = forecolor;
								break;
							case 0x01:
								temp = (forecolor & 0x70) | (back & 0x07);
								break;
							case 0x02:
								temp = (back & 0x70) | (forecolor & 0x07);
								break;
							default:
								temp = back;
								break;
						}
						
						g_dispBuf[x + i][y + j] = temp;
						
						j++;
						if(j >= width)
						{
							break;
						}
						
						data >>= 2;
					}
				}
			}
			break;
		default:
			break;
	}
}

/**
  * @brief  Display a char using a bitmap font set.
  * @param  fontCode:  pointer to text string.
  * @param  destx:  Destination X coordinate (0-239).
  * @param  desty:  Destination Y coordinate (0-239).
  * @param  forecolor:   Foreground color.
  * @param  bckgrndcolor:   Background color.
  * @param  charParams:  Char display parameters structure @ref LCD_CharStruct
  * @retval
  */
static void LCD_SetChar(uint8_t fontCode, uint8_t destx, uint8_t desty, uint8_t forecolor, 
						uint8_t bckgrndcolor, LCD_CharStruct *charParams)
{
	uint16_t i,j;
	uint32_t addr;
	uint16_t width,height;
	uint8_t pxlen;
	uint8_t *p_font = NULL;
	
	if((destx > LCD_LINE_CNT_MAX) || (desty > LCD_PIXEL_ONELINE_MAX)
		|| (fontCode < charParams->ascii_offset))
	{
		return;
	}
	
	p_font = (uint8_t *)charParams->pxdata;
	//根据字符宽度计算所占字节长度
	pxlen = ceil(charParams->width/8.f);
	//字符在字库中起始偏移地址
	addr = (fontCode - charParams->ascii_offset)*(charParams->height*pxlen);
	
	height = charParams->height;
	if((LCD_LINE_CNT_MAX - destx) < height)
	{
		//防止溢出
		height = LCD_LINE_CNT_MAX - destx;
	}
	
	width = charParams->width;
	if((LCD_PIXEL_ONELINE_MAX - desty) < width)
	{
		//防止溢出
		width = LCD_PIXEL_ONELINE_MAX - desty;
	}
	
	for(i = 0; i < height; i++)
	{	
		for(j = 0; j < width; j++)
		{	
			if(p_font[addr+pxlen*i+j/8] & (0x80>>(j%8)))
			{
				g_dispBuf[destx + i][desty + j] = forecolor;
			}
			else
			{
				if(bckgrndcolor != LCD_NONE)
				{
					g_dispBuf[destx + i][desty + j] = bckgrndcolor;
				}
			}
		}
	}
}

